import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './EmployeeList.css';
import { fetchEmployees } from '../utils/api';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    const loadEmployees = async () => {
      try {
        const data = await fetchEmployees();
        setEmployees(data);
      } catch (error) {
        console.error('Failed to fetch employees', error);
      }
    };

    loadEmployees();
  }, []);

  return (
    <div className="employee-list-container">
      <h2>Employee List</h2>
      <Link to="/employee-edit">Create Employee</Link>
      <table>
        <thead>
          <tr>
            <th>Unique Id</th>
            <th>Image</th>
            <th>Name</th>
            <th>Email</th>
            <th>Mobile No</th>
            <th>Designation</th>
            <th>Gender</th>
            <th>Course</th>
            <th>Create Date</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((emp) => (
            <tr key={emp._id}>
              <td>{emp._id}</td>
              <td><img src={emp.image} alt={emp.name} /></td>
              <td>{emp.name}</td>
              <td>{emp.email}</td>
              <td>{emp.mobile}</td>
              <td>{emp.designation}</td>
              <td>{emp.gender}</td>
              <td>{emp.course}</td>
              <td>{new Date(emp.createdDate).toLocaleDateString()}</td>
              <td>
                <Link to={`/employee-edit/${emp._id}`}>Edit</Link> - <button onClick={() => { /* Handle Delete */ }}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeList;
